import { getPersonnelMsgs, readPersonnelMsgAfter } from '@/api/personnel/personnelMsg'

export default {
    data () {
        return {
            
        }
    },
    mounted () {
       
    },
    methods: {
        greeting: function(id) {
            var imgs = [];
            imgs[1] = "data:image/png;base64,";
            imgs[2] = "data:image/png;base64,";
            var that = this;
            if (window.appv.greeting == false) {
                return;
            }
            getPersonnelMsgs({
                id: id,
                readStatus: id ? '' : 'n',
                todayMsg: id ? '' : 'y',
            }).then(res => {
                var data = res.data || {};
                var msgs = data.personnelMsgs;
                if (msgs) {
                    var msg = msgs[0];
                    var content = msg.content;
                    content = content.replace('img_' + msg.contentTypeDict, imgs[msg.contentTypeDict]);
                    layer.open({
                        type: 1
                        ,title: false //不显示标题栏
                        ,closeBtn: true
                        ,area: ['auto', 'auto']
                        ,shade: 0.8
                        ,id: 'LAY_layuipro' //设定一个id，防止重复弹出
                        ,resize: false
                        // ,btn: ['关闭']
                        ,btnAlign: 'c'
                        ,moveType: 1 //拖拽模式，0或者1
                        ,content: content
                        ,yes: function(layero){
                            readPersonnelMsgAfter(msg.id);
                            layer.closeAll();
                        },
                        cancel: function(){ 
                            readPersonnelMsgAfter(msg.id).then(res => {
                                if (!id) {
                                    that.greeting(id);
                                }
                            });
                            //return false 开启该代码可禁止点击该按钮关闭
                        }
                    });
                }
            });
            
        }
    }
}